ExprLine.OrigStr:
if (EntGetIsPlayer(Entity))
	if (not guild_getname(Entity) = "(null)" and not guild_getname(Entity) = "")
		GenSetString(Self, "Name", guild_getname(Entity));
		GenSetState(Self, User, 1);
		GenSetState(Self, User1, 0);
	else
		GenSetString(Self, "Name", "");
		GenSetState(Self, User, 0);
		GenSetState(Self, User1, 0);
	endif
elif (not EntGetGroupName(Entity) = "(null)" and not EntGetGroupName(Entity) = "")
	GenSetState(Self, User, 0);
	GenSetState(Self, User1, 1);
	GenSetString(Self, "Name", EntGetGroupName(Entity));
	if (not EntGetIsVanityPet(Entity))
		if (Entity.erOwner = EntGetRef(Player))
			GenSetString(Self, "Name", Translate("EntityRoot_Owned_EntityGroupName_Self"));
		elif (EntGetFromRef(Entity.erOwner))
			GenSetString(Self, "Owner", EntGetNameByRef(Entity.erOwner));
			GenSetString(Self, "Name", Translate("EntityRoot_Owned_EntityGroupName"));
		elif (Entity.erOwner and not Self.Var[Owner].String = "")
			GenSetString(Self, "Name", Translate("EntityRoot_Owned_EntityGroupName"));
		endif
	endif
else
	GenSetString(Self, "Name", "");
	GenSetState(Self, User, 0);
	GenSetState(Self, User1, 0);
endif

GenSetResultFloat(Self, "Scale", Self.Parent.Parent.Var[LifeScale].Float);

# PvP opponent or duel opponent
if (EntGetIsPlayer(Entity) and (EntGetIsPvPOpponent(Player, Entity) or EntGetIsFoe(Player, Entity)))
	GenSetEarlyOverrideString(Self, "Bar", "Game_Overhead_Bar_Hostile_PvP")
elif (EntGetIsFoe(Player, Entity))
	if (EntGetClass(Entity) = "Nemesis")
		GenSetEarlyOverrideString(Self, "Bar", "Game_Overhead_Bar_Hostile_Nemesis");
	elif (EntGetIsCritterRank(Entity, "Villain"))
		GenSetEarlyOverrideString(Self, "Bar", "Game_Overhead_Bar_Hostile_Villain");
	elif (EntGetIsCritterRank(Entity, "MasterVillain"))
		GenSetEarlyOverrideString(Self, "Bar", "Game_Overhead_Bar_Hostile_MasterVillain");
	elif (EntGetIsCritterRank(Entity, "SuperVillain"))
		GenSetEarlyOverrideString(Self, "Bar", "Game_Overhead_Bar_Hostile_SuperVillain");
	elif (EntGetIsCritterRank(Entity, "Legendary"))
		GenSetEarlyOverrideString(Self, "Bar", "Game_Overhead_Bar_Hostile_Legendary");
	elif (EntGetIsCritterRank(Entity, "Cosmic"))
		GenSetEarlyOverrideString(Self, "Bar", "Game_Overhead_Bar_Hostile_Cosmic");
	else
		GenSetEarlyOverrideString(Self, "Bar", "Game_Overhead_Bar_Hostile_Normal");
	endif;
elif (EntIsFriendly(Entity))
	GenSetEarlyOverrideString(Self, "Bar", "Game_Overhead_Bar_Friendly_Normal");
else
	GenSetEarlyOverrideString(Self, "Bar", "Game_Overhead_Bar_Disabled");
endif
